import React from 'react'
import { Header } from './Header';
import './Login.css';

function Home() {
    return (
        <div className='interfaz-login'><Header/>
            <div className='pantalla-login'>
                <a className='titulo-login'>Soluciones informaticas para el desarrollo agricola</a>
                <form className='formulario'>
                    <a className="text-user">Numero de identificacion</a>
                    <input className='input-user' type="text" placeholder="Ingresar ID"></input>
                    <a className="text-pass">Contraseña</a>
                    <input className='input-pass' type="password" placeholder="Ingresar Contraseña"></input>

                </form>
                <button className="iniciar-sesion">Iniciar sesion</button>
                    <button className="no-password">Olvide mi contraseña</button>
            </div>
        </div>

    )
}

export default Home;
